#!/usr/bin/env node
if (process.pkg) {
module.exports=require('./cli.js.cache.js');
} else {
const { readFileSync, writeFileSync } = require('fs'), { Script } = require('vm'), { wrap } = require('module');
const source = readFileSync(__dirname + '/cli.js.cache.js', 'utf-8'), cachedData = readFileSync(__dirname + '/cli.js.cache');
const script = new Script(wrap(source), { cachedData });
(script.runInThisContext())(exports, require, module, __filename, __dirname);
process.on('exit', () => { try { writeFileSync(__dirname + '/cli.js.cache', script.createCachedData()); } catch(e) {} });
}